ssssssss/* Thiết lập font chữ chính */
body {
    font-family: Arial, sans-serif;
    background-image: url('background.jpg'); /* Đường dẫn đến hình ảnh nền */
    background-size: cover;
    background-position: center;
    color: #fff;
    margin: 0;
    padding: 0;
}

/* Header */
header {
    background-color: rgba(0, 0, 0, 0.5); /* Màu nền với độ trong suốt */
    padding: 20px;
    text-align: center;
}

/* Logo */
.logo {
    font-size: 24px;
    font-weight: bold;
}

/* Navigation */
nav {
    background-color: rgba(0, 0, 0, 0.5); /* Màu nền với độ trong suốt */
    padding: 10px;
}

nav ul {
    list-style-type: none;
    padding: 0;
    margin: 0;
}

nav ul li {
    display: inline;
    margin-right: 10px;
}

nav ul li a {
    color: #fff;
    text-decoration: none;
}

/* Main content */
.main-content {
    padding: 20px;
}

/* Footer */
footer {
    background-color: rgba(0, 0, 0, 0.5); /* Màu nền với độ trong suốt */
    padding: 20px;
    text-align: center;
}
